// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TransferContract {
    function transfer(
        address from,
        address to,
        string memory message,
        uint256 amount
    ) public {
        // Perform necessary validations and checks before transferring the amount
        
        // Ensure that the sender has sufficient balance
        require(amount > 0, "Invalid amount");
        require(from != address(0), "Invalid 'from' address");
        require(to != address(0), "Invalid 'to' address");
        require(
            amount <= address(this).balance,
            "Insufficient contract balance"
        );
        
        // Perform the transfer
        payable(to).transfer(amount);
        
        // Emit an event to indicate the successful transfer
        emit Transfer(from, to, message, amount);
    }
    
    // Event emitted when a transfer is successfully executed
    event Transfer(
        address indexed from,
        address indexed to,
        string message,
        uint256 amount
    );
}

